import brand1 from './brand1.png';
import brand2 from './brand2.png';
import brand3 from './brand3.png';
import brand4 from './brand4.png';
import brand5 from './brand5.png';

let brands = [
    {
        id: 1,
        image: brand2,
    },
    {
        id: 2,
        image: brand3,
    },
    {
        id: 3,
        image: brand4,
    },
    {
        id: 4,
        image: brand5,
    }
];

export default brands;
